const questions = [
    {
        q: "data:image/webp;base64,",
        a: "data:image/webp;base64,",
        type: "unsafe",
        msg: " BEC<br>!,Gmail<br> "
    },
    {
        q: "data:image/webp;base64,",
        a: "data:image/webp;base64,",
        type: "unsafe",
        msg: " <br>,<br>,,<br> "
    },
    {
        q: "data:image/webp;base64,",
        a: "data:image/webp;base64,",
        type: "safe",
        msg: " <br> <strong></strong><br><br> "
    }
];

let currentIdx = 0;
const card = document.getElementById('quiz-card');
const imgQ = document.getElementById('img-q');
const imgA = document.getElementById('img-a');
const feedbackText = document.getElementById('feedback-text');
const nextBtn = document.getElementById('next-btn');
const restartBtn = document.getElementById('restart-btn');
const btns = document.querySelectorAll('.controls .btn');
const currentNumSpan = document.getElementById('current-num');
const totalNumSpan = document.getElementById('total-num');
const btnSafe = document.getElementById('btnsafe');
const btnUnsafe = document.getElementById('btnunsafe');

totalNumSpan.innerText = questions.length;
loadQuestion(currentIdx);

btnSafe.addEventListener('click', () => checkAnswer('safe'));
btnUnsafe.addEventListener('click', () => checkAnswer('unsafe'));

function loadQuestion(index) {
    const data = questions[index];
    card.classList.remove('is-flipped');
    card.classList.remove('glow-safe', 'glow-unsafe');

    feedbackText.innerText = "";

    // ---  active class  display: none ---
    // document.getElementById('feedback-box').style.display = 'none'; // 
    const feedbackBox = document.getElementById('feedback-box');
    feedbackBox.classList.remove('active');
    // -----------------------------------------------------------

    nextBtn.style.display = "none";
    restartBtn.style.display = "none";

    btns.forEach(btn => btn.disabled = false);

    imgQ.src = data.q;
    //  timeout
    setTimeout(() => { imgA.src = data.a; }, 200);

    currentNumSpan.innerText = index + 1;
}

function checkAnswer(userChoice) {
    const data = questions[currentIdx];
    const isCorrect = (userChoice === data.type);

    card.classList.add('is-flipped');
    btns.forEach(btn => btn.disabled = true);

    if (data.type === 'safe') {
        card.classList.add('glow-safe');
    } else {
        card.classList.add('glow-unsafe');
    }

    // ---  active class  ---
    // document.getElementById('feedback-box').style.display = 'block'; // 
    const feedbackBox = document.getElementById('feedback-box');
    feedbackBox.classList.add('active');
    // ---------------------------------------------

    if (isCorrect) {
        feedbackText.innerHTML = `<span style="color:#22c55e; font-size:20px;"> !</span><br><br>${data.msg}`;
    } else {
        feedbackText.innerHTML = `<span style="color:#ef4444; font-size:20px;"> !</span><br><br>${data.msg}`;
    }

    //  ()
    // setTimeout(() => {
    //   feedbackBox.scrollIntoView({ behavior: 'smooth', block: 'nearest' });
    // }, 300);

    if (currentIdx === questions.length - 1) {
        nextBtn.innerText = " ";
        nextBtn.style.display = "inline-block";
        nextBtn.onclick = finishQuiz;
    } else {
        nextBtn.innerText = " ";
        nextBtn.style.display = "inline-block";
        nextBtn.onclick = nextQuestion;
    }
}

function nextQuestion() {
    if (currentIdx < questions.length - 1) {
        currentIdx++;
        loadQuestion(currentIdx);
    }
}

function finishQuiz() {
    nextBtn.style.display = "none";
    restartBtn.style.display = "inline-block";
    feedbackText.innerHTML = " <span style='font-size:20px; font-weight:700;'>!</span><br><br><span style='font-size:15px; color:#6b7280;'>,</span>";
}

function resetQuiz() {
    currentIdx = 0;
    loadQuestion(0);
}